import React, { Component } from 'react'


class BlogList extends Component {
    constructor(props) {
        super(props);
        this.state = { date: new Date() };
    }
    render() {

        const numbers = [1, 2, 3, 'cat', 5];


        const listItems = numbers.map((number) =>
            <li>{number}</li>);
        return (
            <div>
                <ul>{listItems}</ul>
                <h1>Blog List {this.state.date.toLocaleTimeString()}</h1>
            </div>
        );
    }
}

export default BlogList
